import logo from './logo.svg';
import './App.css';

console.log("App component running");

const title = {
  title: 'My Main Title',
  subtitle: 'My Sub Title',
  list: [
    'list Item 1',
    'list Item 2'
  ]
}

 function App() {
  return (
    <div>
      <h1>{title.title}</h1>
      {title.subtitle && <p>{title.subtitle}</p>}
      <p>{title.list.length > 0 ? 'Options Available' : 'No Available Options'}</p>
      <ol>
        <li>Item One</li>
      </ol>
    </div>
  );
}







//Render Default
export default App;
